import {
  BrowserRouter as Router,
  Route,
  Routes,
  Switch,
} from "react-router-dom";
import Homepage from "./Components/Homepage";
import Sidebar from "./Components/MainComponents/Sidebar";
import React from "react";

const App: React.FC = () => {
  return (
    <Router>
      <div>
        <Sidebar />
        <Switch>
          <Routes>
            <Route path="/Homepage" element={<Homepage />} />
          </Routes>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
